def letter_to_sequence_type(a):
	ai = 0
	if(a == "A" or a == "a"):
		ai = 1
	elif(a == "C" or a == "c"):
		ai = 2
	elif(a == "G" or a == "g"):
		ai = 3
	elif(a == "U" or a == "u"):
		ai = 4
	
	return ai

